const StateCreator = (props) => {

    let [visibility, setVisibility] = useState(props.visibility);

    let style = {
        position: 'absolute',
        height: '100vh',
        border: '1px solid black',
        top: '0px',
        right: '0px',
        width: '20vw',
        backgroundColor: 'white',
        display: props.visibility
    }


    const closeCreator = () => {
        style.display = 'none'
    }

    return (
        <div style={style}>
            <button onClick={closeCreator}>X</button>


        </div>
    );
};

export default StateCreator;
